import React, { useState } from 'react'
import './book.css'
function book(props) {
    const [value , setValue] = useState(0);
    function inc(){
        setValue(value +1);
    }
    function dec(){
        setValue(value -1);
    }

  return (
    <div id="book">
        <img src="data:image/jpeg;base64," alt="" height={100} width={100}></img>
        <h1>Title: {props.Title}</h1>
        <h1>Price : {props.Price}</h1>
        <div>
            <button onClick={inc}> +</button>
            <span> {value}</span>
            <button onClick={dec}> -</button>
        </div>
    </div>
  )
}

export default book